    UpdateSettings {
            owner_id: Option<Addr>,
            slot_granularity: Option<u64>,
            paused: Option<bool>,
            agent_fee: Option<Coin>,
            gas_price: Option<u32>,
            proxy_callback_gas: Option<u32>,
            agent_task_ratio: Option<Vec<u64>>,
            agents_eject_threshold: Option<u64>,
        },
    MoveBalances {
            balances: Vec<Balance>,
            account_id: Addr,
        },
    RegisterAgent {
            payable_account_id: Option<Addr>,
        },
    UpdateAgent {
            payable_account_id: Addr,
        },
    CheckInAgent {
        },
    UnregisterAgent {
        },
    WithdrawReward {
        },
    CreateTask {
            task: TaskRequest,
        },
    RemoveTask {
            task_hash: String,
        },
    RefillTaskBalance {
            task_hash: String,
        },
    ProxyCall {
        },
    ProxyCallback {
            task_hash: String,
            current_slot: u64,
        },
}

